from libnum import n2s, s2n
from gmpy2 import invert

# 扩展欧几里得算法


def egcd(a, b):
    if a == 0:
        return (b, 0, 1)
    else:
        g, y, x = egcd(b % a, a)
        return (g, x - (b // a) * y, y)


